import React, { useState } from 'react';
import axios from 'axios';

export function Navbar() {

    return(
        <div style={{display: 'flex', justifyContent: 'space-between', paddingBottom: '15px', paddingTop: '20px', backgroundColor: 'aliceblue'}}>
            <h3 style={{marginLeft: '50px', marginRight: '20px'}}>
                Notes
            </h3>
            <input type='text' style={{marginLeft: '20px'}}/>
            <text style={{marginRight: '50px', backgroundColor: 'LightCoral', padding: '6px', paddingTop: '6px', borderRadius: '4px'}}>Sign In</text>
        </div>
    );
}
